import * as Items from './Items'

function CardData(picture, title, description){
    this.picture = picture;
    this.title = title;
    this.description = description;
}

export var theCards = [];
theCards = [new CardData("ss", "ok", "iy"), new CardData("ss", "this is [80] title", "iy")];
theCards.push(new CardData("ss", "HEYHEYU", "ily"));

function cardList() {
    return (
        <>
            {myCardList}
        </>
    )
}

export var myCardList = []

for (var i of theCards){
    myCardList.push(Items.Card(i.picture, i.title, i.description))
}
